function fn_convert_base(str, fromBase, toBase) {
  
  function add(x, y, base) {
    var z = [];
    var n = Math.max(x.length, y.length);
    var carry = 0;
    var i = 0;
    while (i < n || carry) {
      var xi = i < x.length ? x[i] : 0;
      var yi = i < y.length ? y[i] : 0;
      var zi = carry + xi + yi;
      z.push(zi % base);
      carry = Math.floor(zi / base);
      i++;
    }
    return z;
  }

  function multiply_by_number(num, x, base) {
    if (num < 0) return null;
    if (num == 0) return [];

    var result = [];
    var power = x;
    while (true) {
      if (num & 1) {
        result = add(result, power, base);
      }
      num = num >> 1;
      if (num === 0) break;
      power = add(power, power, base);
    }

    return result;
  }

  var digits = str.split('');
  var ary = [];
  for (let i = digits.length - 1; i >= 0; i--) {
    var n = parseInt(digits[i], fromBase);
    if (isNaN(n)) return null;
    ary.push(n);
  }
  digits = ary;

  if (digits === null) return null;

  var outArray = [];
  var power = [1];
  for (let i = 0; i < digits.length; i++) {
    // invariant: at this point, fromBase^i = power
    if (digits[i]) {
      outArray = add(outArray, multiply_by_number(digits[i], power, toBase), toBase);
    }
    power = multiply_by_number(fromBase, power, toBase);
  }

  var out = '';
  for (let i = outArray.length - 1; i >= 0; i--) {
    out += outArray[i].toString(toBase);
  }
  return out;
}

function fn_dec_to_hex(decStr) {
  var hex = fn_convert_base(decStr, 10, 16);
  return hex ? hex : null;
}

// parses #thread-f:<ID>|msg-f:<ID> from element attr data-thread-id
function fn_get_thread_and_message_data(element) {
  var attr_value = element.attr('data-thread-id');
  var legacy_thread_id = element.attr('data-legacy-thread-id');
  var legacy_message_id = element.attr('data-legacy-last-message-id');
  var tokens = attr_value.split('|');
  var ret = {};
  var token;
  for(var i = 0; i < tokens.length; i++) {
    token = tokens[i].replace('#', '');
    if (token.startsWith('thread') && legacy_thread_id) {
      ret['thread_id'] = legacy_thread_id; 
    } else if (token.startsWith('msg') && legacy_message_id) {
      ret['message_id'] = legacy_message_id;
    } else if (token.startsWith('thread-f:')) {
      ret['thread_id'] = fn_dec_to_hex(token.replace(/\D+/g, ''));
    } else if (token.startsWith('msg-f:')) {
      ret['message_id'] = fn_dec_to_hex(token.replace(/\D+/g, ''));
    }
  }
  return ret;
}

