function fn_create_context_menu_impl(btn_element, sub_items, submenu_class, callback) {

  function calculate_submenu_position() {
    var offset = element.offset();
    var submenu_top = offset.top - sub_menu.innerHeight();
    var submenu_left = 0;
    var space_on_right = (window.innerWidth - element.offset().left);
    if (space_on_right < sub_menu.width()) {
      submenu_left = offset.left - sub_menu.width();
    } else {
      submenu_left = offset.left;
    }

    if (submenu_top < 0) {
      submenu_top = 0;
    }

    return {
      'left': submenu_left,
      'top': submenu_top
    };
  }

  function add_sub_menu_item(sub_item, target) {
    var menu_item_inner = jquery_default()('<div class="J-N-Jz" />')
    menu_item_inner.attr('title', sub_item['title']);
    menu_item_inner.attr('style', 'user-select: none;width:250px;display:block;text-overflow: ellipsis;overflow: hidden; white-space: nowrap;');
    menu_item_inner.text(sub_item['title']);
    var sub_menu_item = jquery_default()('<div class="J-N" role="menuitem" aria-hidden="true" style="user-select: none;"></div>')
      .append(menu_item_inner)
      .appendTo(target);
    sub_menu_item.data('menu-item', sub_item);
    sub_menu_item.click(function () {
      callback(jquery_default()(this).data("menu-item"));
      sub_menu.hide();
    });
  }

  function display_submenu() {

    sub_menu_inner_div.empty();

    var item;
    var list = sub_items;
    try {
      if (list && list.length > 0) {

        for (var i = 0; i < list.length; i++) {

          item = list[i];

          switch (item['kind'] || '') {
            case 'separator':
              var sub_menu_sep = jquery_default()('<div class="J-Kh" aria-disabled="true" role="separator" style="user-select: none;z-index:10001"></div>');
              sub_menu_inner_div.append(sub_menu_sep);
              if (item['title'] && item['title'].trim() !== '') {
                var sub_menu_sep_with_text = jquery_default()('<div style="font-size:11px;font-weight:bold;margin:-5px 0 5px 0;padding:4px 0 5px 16px;background:#f9f9f9"></div>');
                sub_menu_sep_with_text.text(item['title'].trim());
                sub_menu_inner_div.append(sub_menu_sep_with_text);
              }
              break;

            default:
              add_sub_menu_item(item, sub_menu_inner_div);
              break;
          }

        }
      }
    } catch (ex) {
      console.log('error:', ex);
    }

    sub_menu.find('.J-N')
      .unbind('mouseenter').bind('mouseenter', function () {
        jquery_default()(this).addClass('J-N-JT');
      })
      .unbind('mouseleave').bind('mouseleave', function () {
        jquery_default()(this).removeClass('J-N-JT');
      });

    var position = calculate_submenu_position();

    sub_menu.css({
      'top': position.top + "px",
      'left': position.left + "px",
      'opacity': '1',
      'display': 'block'
    }).show();
    setTimeout(function() {
      sub_menu.show();
    });
    
  }

  function create_submenu_div(callback) {
    sub_menu = jquery_default()('<div class="J-M agd aYO jQjAxd ' + g_gmail_sheets_context_sub_menu_item_class + ' ' + submenu_class + '" style="user-select: none; top: 0px;display:none" role="menu" aria-haspopup="true"></div>').hide();
    sub_menu_inner_div = jquery_default()('<div class="SK AX" style="user-select: none;"></div>').appendTo(sub_menu);
    jquery_default()('body').append(sub_menu);
    if (callback) {
      callback();
    }
  }

  var element = jquery_default()(btn_element);
  var sub_menu = null;
  var sub_menu_inner_div = null;
  create_submenu_div();

  element.click(function () {
    // always get latest sub_items from saved settings
    sub_items = fn_get_message_menu_subitems();
    if (sub_items && sub_items.length) {
      if (jquery_default()('.' + submenu_class).length == 0) {
        create_submenu_div(function() {
          display_submenu();
        });
      } else if (jquery_default()('.' + g_gmail_sheets_context_sub_menu_item_class).is(":hidden")) {
        display_submenu();
      } else {
        jquery_default()('.' + g_gmail_sheets_context_sub_menu_item_class).hide();
      }
    } else {
      callback({
        "id": "default"
      });
    }
  });

  jquery_default()(document).click(function (e) {
    if (jquery_default()(e.target).closest('#' + element.get(0).id).length === 0 && jquery_default()(e.target).closest('.' + g_gmail_sheets_context_sub_menu_item_class).length === 0) {
      jquery_default()('.' + g_gmail_sheets_context_sub_menu_item_class).hide();
    }
  });
}

