function fn_get_search_term_impl() {

  var advanced_search_term = '';
  var label_part = "";
  var other_part = "";
  if (jquery_default()(g_css_selector_search_options_dialog).length > 0) {
    var searchinp = jquery_default()('[name=q]').not('button').first();
    if (searchinp && searchinp.length > 0 && searchinp.val()) {
      if (searchinp.val().match(/label:/)) {
        var label_list = searchinp.val().trim().split(/LABEL:/i);
        for (let br = 1; br < label_list.length; br ++) {
          if (label_list[br]) {
            label_part = label_part + 'label:' + label_list[br].replace(/\s.*/, '') + ' '
          }
        }
      } 
      other_part = searchinp.val().replace(/label:\S+/i, '');
      if (other_part) {
        other_part = other_part + ' ';
      }
    }

    // return searchinp.val();

    advanced_search_term = jquery_default().grep(jquery_default()(g_css_selector_search_options_dialog).find('input[type=text]').map(function(i) {
      if (!this.value || this.value.trim() === '') {
        return null;
      } else if (i == 0) {
        return 'from:(' + this.value.trim() + ')';
      } else if (i == 1) {
        return 'to:(' + this.value.trim() + ')';
      } else if (i == 2) {
        return 'subject:(' + this.value.trim() + ')';
      } else if (i == 3) {
        // if keyword already has other_path then we do not need other_path - it is just duplicate
        var keyword = this.value.trim();
        if (keyword && keyword.indexOf(other_part.trim()) != -1) {
          other_part = '';
        }
        return keyword;
      }
      return null;
    }), function(v) {
      return v && v !== '';
    }).join(' ').trim();
  }
  if (other_part && advanced_search_term) {
    if (other_part.trim() == advanced_search_term.trim()) {
      advanced_search_term = '';
    }
    var advanced_search_term_no_brackets = advanced_search_term.replaceAll('(', '').replaceAll(')','')
    if (other_part.trim() == advanced_search_term_no_brackets.trim()) {
      other_part = '';
    }
  }

  var ret = ""
  if (advanced_search_term.length > 0) {
    ret = label_part + other_part + advanced_search_term;
  } else if (jquery_default()('#gbqfq').length > 0) {
    ret = jquery_default()('#gbqfq').val() + '';
  } else if (jquery_default()('input.gb_6e').length > 0) {
    ret = jquery_default()('input.gb_6e').val() + '';
  } else if (jquery_default()('input.gb_9e').length > 0) {
    ret = jquery_default()('input.gb_9e').val() + '';
  } else if (jquery_default()('.gb_rf.gb_lf input').length > 0) {
    ret = jquery_default()('.gb_rf.gb_lf input').val()+ '';
  } else if (g_new_gmail_interface) {
    var searchinp = jquery_default()('[name=q]').not('button').first();
    ret = searchinp.val();
  }
  ret = ret.trim();

  // get [data-query]
  // it might be that search dialog is basically empty (user delete it)
  // however if data-query is still there and user see what data-query is set to
  var data_query = jquery_default()('[data-query]').filter(':visible').attr('data-query');
  if (data_query && ret.indexOf(data_query) == -1) {
    ret = data_query + ' ' + ret;
  }
  return ret;
}

function fn_get_selected_category_name() {
  var css_class_mapper = {
    'aIf-aLf': 'Primary',
    'aKe-aLf': 'Social',
    'aJi-aLf': 'Promotions',
    'aH2-aLf': 'Updates',
    'aHE-aLf': 'Forums',
    'aIf-aLe': 'Primary',
    'aKe-aLe': 'Social',
    'aJi-aLe': 'Promotions',
    'aH2-aLe': 'Updates',
    'aHE-aLe': 'Forums'
  };
  var category_el = jquery_default()(".aKk [aria-selected='true']");
  if (category_el.length > 0) {
    for(var key in css_class_mapper) {
      if (category_el.find('.' + key).length == 1) {
        return css_class_mapper[key];
      }
    }
  }
  return null;
}

function fn_get_message_list_query_from_url() {
  var message_query = '';
  // try to get query from url... just in case
  var gmail_url = c_g_cmn.fn_get_redirect_url();
  console.log('fn_get_message_list_query_from_url: gmail_url=', gmail_url);
  if (gmail_url.match(/#inbox/)) {
    var category = fn_get_selected_category_name();
    if (category && category != "") {
      message_query = 'label:inbox category:' + category; 
    }
    else {
      message_query = 'label:inbox'; 
    }
  } else if (gmail_url.match(/#all/)) {
    message_query = 'label:all'; 
  } else if (gmail_url.match(/#search/) || gmail_url.match(/#label/) || gmail_url.match(/#advanced-search/)) {
    message_query = ''; 
  } else {
    // not sure - better be safe
    message_query = ''
  }
  return message_query;
}

