function fn_setup_monitoring_of_selected() {
   c_cmn.fn_delayed_conditional_execute({
    poll_delay: 500,
    max_poll_attempts: 5000,
    retry_message: null,
    condition: function () {
      var pass = false;
      if (jquery_default()(g_selector_toolbar_container_div).length > 0 && jquery_default()(g_selector_toolbar_container_div).is(':visible')) {
        pass = true;
      }
      return pass;
    },
    continuation: function () {
      setTimeout(function () {
        fn_setup_monitoring_of_selected_impl();
      }, 1000);


      return true;
    }
  });
}

function fn_is_something_checked() {
  if (jquery_default()('.zA [role=checkbox][aria-checked="true"]').filter(':visible').length > 0) {      
    return true;
  } else {
    return false;
  }
}

function fn_setup_monitoring_of_selected_impl() {
  
  // insert toolbar button
  function hide_or_show_toolbar_buttons() {
    if (fn_is_something_checked()) {
      let style_id = 'monitoring_of_selected';
      jquery_default()('#' + style_id).remove();
      jquery_default()('<style />')
      .attr('id', style_id)
      .html(
        "[data-rowlist-toolbar='true'] [data-rowlist-toolbar='true'] { display: flex !important; } " + 
        "[data-rowlist-toolbar='true'] [data-thread-toolbar='true'] { display: none !important; } "
      )
      .appendTo('head');
      jquery_default()(".chqBtnSaveToDropdown").closest('.inboxsdk__button').hide();
    } else {
      let style_id = 'monitoring_of_selected';
      jquery_default()('#' + style_id).remove();
      jquery_default()('<style />')
      .attr('id', style_id)
      .html(
        "[data-rowlist-toolbar='true'] [data-rowlist-toolbar='true'] { display: none !important; } " + 
        "[data-rowlist-toolbar='true'] [data-thread-toolbar='true']  { display: flex !important; } "
      )
      .appendTo('head');

      jquery_default()("[data-thread-toolbar='true'] [data-rowlist-toolbar='true']").hide();
      jquery_default()(".chqBtnSaveToDropdown").closest('.inboxsdk__button').show();

    }
  }

  function setup_observe_of_checkboxes() {
    // disconnect all old observers
    g_observer_for_toolbar_buttons_list_2.forEach(function(observer) {
      observer.disconnect();
    })
    g_observer_for_toolbar_buttons_list_2 = [];
    jquery_default()(g_selector_thread_row_checkbox_div).each(function(index, elem_to_observe) {

      // reconnect them
      let observer = new MutationObserver(function (mutations) {
        mutations.some(function(mutation) {
          hide_or_show_toolbar_buttons();
          return true;
        });
      });
      observer.observe(elem_to_observe, { attributes: true, attributeFilter: ['aria-checked']});
      g_observer_for_toolbar_buttons_list_2.push(observer);
    
    });
  }

  // observe
  try {

    hide_or_show_toolbar_buttons();

    // disconnect all old observers
    g_observer_for_toolbar_buttons_list_1.forEach(function(observer) {
      observer.disconnect();
    })
    g_observer_for_toolbar_buttons_list_1 = [];
    jquery_default()(g_selector_toolbar_wapper_div).each(function(index, elem_to_observe) {

      // reconnect them
      let observer = new MutationObserver(function (mutations) {
        mutations.some(function(mutation) {
          if (mutation && mutation.addedNodes && mutation.addedNodes.length > 0) {
            setTimeout(function() { setup_observe_of_checkboxes() }, 500); 
            setTimeout(function() { setup_observe_of_checkboxes() }, 3000); /* if it is fast or slow */
            return true;
          }
        });
      });
      observer.observe(elem_to_observe, { childList: true });
      g_observer_for_toolbar_buttons_list_1.push(observer);
    
    });

    hide_or_show_toolbar_buttons();
    setup_observe_of_checkboxes();

  } catch(err) {

  }
}

function fn_register_message_listeners() {

  window.addEventListener('message', function(event) {
  
    var origin  = event.origin;
    var message = event.data;

    if (message.type && message.type === 'CHQ_IFRAME_CLOSE') {
      fn_save_state_to_local_storage(function() {
        var dialog = fn_get_screen_dialog();
        if (dialog) {
          dialog.close();
          jquery_default()('.chq-campaign-overlay').remove();
        }
      });
    }
    else if (message.type && message.type === 'CHQ_REFRESH_WINDOW') {
      fn_save_state_to_local_storage(function() {
        var port;
        port = fn_get_background_port();
        port.postMessage(message);
      });
    }
    else if (message.type && message.type === 'CHQ_SHOW_UPGRADE_DIALOG') {
      fn_show_upgrade_dialog();
    }
    else if (message.type && (message.type === 'CHQ_GMAIL_SHEETS_EXPORT_SEARCH_TERM' || message.type === 'CHQ_SHEET_OPEN_QUERYBASED_DIALOG')) {

      c_g_cmn.fn_close_misc_dialog();
      if (message.data && message.data['query']) {
        
        fn_handle_cloudHQ_thread_toolbar_gmail_sheets_via_filter_btn(message.data['query']);

      }
    }
    else if (message.type && message.type === 'CHQ_RULE_IFRAME_CLOSE') {
      
      // TODO: we need to reload rules
      if (message.data && message.data['do_reload']) {
        jquery_default()('#get_custom_column_list_reload_triger').trigger('click');
      }
      fn_save_state_to_local_storage(function () {
        var dialog = fn_get_screen_dialog();
        if (dialog) {
          dialog.close();
          jquery_default()('.chq-campaign-overlay').remove();
        }
      });
    // message from gmail smart labels to save query filter emails
    } else if (message === 'MM:3PCunsupported') {
      console.log('third party cookies are not supported');
      g_3party_cookies_not_supported = true;
    } else if (message === 'MM:3PCsupported') {
      g_3party_cookies_not_supported = false;
      console.log('third party cookies are supported');
    } else if (message.type && message.type === 'CHQ_APP_MENU_ACTION') {
      if (message.payload && message.payload.what && message.payload.what === g_cloudHQ_feature_name && message.payload.action) {
        
        if (message.payload.action === 'ad_hoc_save_gmail_sheets') {
          // check if nothing selected...

          fn_handle_cloudHQ_thread_toolbar_ad_hoc_save_to_sheet();
        } else if (message.payload.action === 'ad_hoc_save_gmail_sheets_existing') {
            fn_handle_cloudHQ_thread_toolbar_ad_hoc_save_to_sheet();

        } else if (message.payload.action === 'ad_hoc_save_gmail_sheets_new') {
          
            fn_display_create_new_spreadsheet_dialog();
            
        } else if (message.payload.action === 'wizard_gmail_sheets') {
          window.open(g_server_url + 'main_gmail_sheets/wizard_step1?email_or_login=' + encodeURIComponent(g_email_or_login || '') + '&switch_login=1');
        } else if (message.payload.action === 'backup_or_save_email_messages') {
          var bar = content_g_sdk.ButterBar.showMessage({
            text: 'Starting wizard, might take a few seconds ...',
            messageKey: 'cloudHQ_butter_1'
          });
          fn_check_login_and_signup_dialog_if_needed(function() {
            var prev_url = g_server_url + 'sheets_wizard';
            var url = g_server_url + 'main_gmail_sheets/wizard_step2?email_or_login=' + encodeURIComponent(g_email_or_login) + '&prev_url=' + prev_url + '&switch_login=1&prev_step=wizard_step1&wizard_what=backup_label' +
              '&is_conversation_view_disabled=' + encodeURIComponent(g_is_conversation_view_disabled) +
              '&gmail_timezone=' + encodeURIComponent(g_gmail_timezone) +
              '&gmail_timezone_offset=' + encodeURIComponent(g_gmail_timezone_offset) +
              '&gmail_language=' + encodeURIComponent(g_lang_of_html);
            window.open(url);
            bar.destroy();
          });
        } else if (message.payload.action === 'extract_information_from_messages') {
          var bar = content_g_sdk.ButterBar.showMessage({
            text: 'Starting wizard, might take a few seconds ...',
            messageKey: 'cloudHQ_butter_1'
          });
          fn_check_login_and_signup_dialog_if_needed(function() {
            var prev_url = g_server_url + 'sheets_wizard';
            var url = g_server_url + 'main_gmail_sheets/wizard_step2?email_or_login=' + encodeURIComponent(g_email_or_login) + '&prev_url=' + prev_url + '&switch_login=1&prev_step=wizard_step1&wizard_what=normal' +
              '&is_conversation_view_disabled=' + encodeURIComponent(g_is_conversation_view_disabled) +
              '&gmail_timezone=' + encodeURIComponent(g_gmail_timezone) +
              '&gmail_timezone_offset=' + encodeURIComponent(g_gmail_timezone_offset) +
              '&gmail_language=' + encodeURIComponent(g_lang_of_html);
            window.open(url);
            bar.destroy();
          });
        }
      }
      
    } 

  });
}

