function fn_check_login_and_signup_dialog_if_needed(next_step_logged_in, next_step_not_logged_in, service_required_what, params) {
  function get_caller_name() {
    let e = new Error();
    var frame_list = e.stack.split("\n");
    var ret = ""
    let frame = e.stack.split("\n")[3];
    let lineNumber = frame.split(":").reverse()[1];
    let functionName = frame.split(" ")[5].replace(/.*\//,'');
    ret = ret + functionName + "-" + lineNumber;
    ret = ret.replace(/:/g, '_')
    return ret;
}

  console.log("fn_check_login_and_signup_dialog_if_needed: ENTERING");

  var caller_name = "";
  try {
    caller_name = get_caller_name();
  } catch(e) {

  }

  var requires_read_write_and_basic_settings_authorization = false;
  if (params && params['requires_read_write_and_basic_settings_authorization']) {
    requires_read_write_and_basic_settings_authorization = true;
  }

  var data = { 
    'email_or_login': g_email_or_login, 
    'switch_login': '1',
    'gmail_timezone_offset': g_gmail_timezone_offset, 
    'gmail_timezone': g_gmail_timezone,
    'is_conversation_view_disabled': g_is_conversation_view_disabled,
    'gmail_language': g_lang_of_html,
    'requires_read_write_and_basic_settings_authorization': requires_read_write_and_basic_settings_authorization,
    'caller_name': caller_name,
    'next_step_url': c_g_cmn.fn_get_redirect_url() 
  };

  c_g_cmn.fn_check_login_and_signup_dialog_if_needed(next_step_logged_in, next_step_not_logged_in, service_required_what, data);

  console.log("fn_check_login_and_signup_dialog_if_needed: EXITING");
}

