function fn_wait_and_insert_cloudHQ_in_label_menu() {

  c_cmn.fn_delayed_conditional_execute({
    poll_delay: 500,
    max_poll_attempts: 2000,
    retry_message: null,
    condition: function () {
      var pass = false;
      if (jquery_default()('[aria-labelledby] .wT').closest('.pp').length > 0 && jquery_default()('[aria-labelledby] .wT').closest('.pp').is(':visible')) {
         pass = true;
       }
      return pass;
    },
    continuation: function() {
      setTimeout(function() {
        fn_insert_cloudHQ_in_label_menu();
      }, 1);
      return true;
    }
  });
  setTimeout(function() {
    fn_insert_cloudHQ_in_label_menu();
  }, 10000);

}

function fn_insert_cloudHQ_in_label_menu() {

  try {
  fn_setup_gmail_label_links();

  if (g_insert_cloudHQ_menu_done) {
    return;
  }

  c_cmn.fn_log('fn_insert_cloudHQ_in_label_menu: ENTERING');

  if (jquery_default()(g_css_search_for_label_dropdown).length > 0) {
    fn_insert_cloudHQ_in_label_menu_impl();
  }
  else {

    c_cmn.fn_log('fn_insert_cloudHQ_in_label_menu: start monitor for change');
    // The g_css_search_for_label_menu_wapper_div is div which contains label dropdown (menu) 
    // We will observe this div and as soon as we get a notification that any of childs under this div are 
    // changed we do the following:
    // - check the menu dropbodown is created (the menu is defined with g_css_search_for_label_dropdown 
    // - of it is there will try to insert our menu item and stop observing
    var elem_to_observe = (jquery_default()('[aria-labelledby] .wT').closest('.pp'))[0];
    var config = { childList: true, subtree: false };

    if (elem_to_observe) {
      var observer = new MutationObserver(
        function (mutations) {
          mutations.some(
            function(mutation) {
              if (jquery_default()(g_css_search_for_label_dropdown).length > 0) {
                fn_insert_cloudHQ_in_label_menu_impl();
                observer.disconnect();
                return true;
              }
            }
          );
        }
      );

      observer.observe(elem_to_observe, config);
    }
  }

  c_cmn.fn_log('fn_insert_cloudHQ_in_label_menu: EXITING');
  } catch(e) {

  }
}

function fn_update_recent_spreadsheets(spreadsheet_id, spreadsheet_name) {
  var list = g_recent_spreadsheets['list'] || [];
  for(var i = 0; i < list.length; i++) {
    if (list[i]['id'] == spreadsheet_id) {
      list.splice(i, 1);
      break;
    }
  }
  list.unshift({id: spreadsheet_id, title: spreadsheet_name});
  list = list.slice(0, 6);
  g_recent_spreadsheets['list'] = list;
  fn_save_state_to_local_storage();

  // remove context menu item and recreate it
  jquery_default()('.' + g_gmail_sheets_context_menu_item_class + ', .' + g_gmail_sheets_context_sub_menu_item_class).remove();
  fn_add_context_view_menu_item();
}

function fn_generate_rules_call(message_id) {
  
  var thread_id_list = fn_get_selected_thread_ids();
  var message_id_list = fn_get_selected_message_ids();
  
  if (message_id) {
    message_id_list.push(message_id);
  }

  console.log('thread_id_list', thread_id_list);
  console.log('message_id_list', message_id_list);

  return new Promise(function(resolve, reject) {
    c_g_cmn.fn_api_request('main_gmail_sheets', 'ad_hoc_generate_rules', {
      'thread_id_list': thread_id_list,
      'message_id_list': message_id_list,
      'gmail_timezone': g_gmail_timezone,
      'gmail_timezone_offset': g_gmail_timezone_offset,
      'gmail_language': g_lang_of_html
    }, function (res) {
      if (res['success']) {
        resolve((res['rules'] && res['rules']['named_rules']) || []);
      } else {
        reject(res);
      }
    }, function (response) {
      reject(response);
    });
  });

}

