function fn_create_context_menu_item(menu, item, sub_items, callback) {

  function setup_hover() {
    menu_item.parent().find('.J-N').unbind('mouseenter mouseleave');
    menu_item.unbind('mouseenter mouseleave');
    menu_item.hover(
      function () {
        jquery_default()(this).addClass('J-N-JT');
        display_submenu();
      },
      function () {
        jquery_default()(this).removeClass('J-N-JT');
      }
    );

    menu_item.parent().find('.J-N').hover(function (e) {
      var target = jquery_default()(e.target);
      if (target.closest('.' + g_gmail_sheets_context_menu_item_class).length === 0) {
        sub_menu.hide();
      }
    });

  }

  function set_observer_on_menu() {
    var targetNode = menu_item.parent().get(0);
    var observer = new MutationObserver(function(entries, observer) { // or replace changes by just:  [ { target } ]
      var menu_list = jquery_default()('.J-M.J-M-ayU.Ft');
      if (menu_list.css('display') == "none") {
        sub_menu.css('opacity', '0');
      }

      entries.forEach(entry => {
        if (entry.type == 'childList') {
          setup_hover();
          return;
        }
      });

    });

    var options = {
      attributes: true,
      childList: true,
      attributeFilter: ['style']
    }

    observer.observe(targetNode, options);
  }

  function calculate_submenu_position() {
    var offset = menu_item.offset();
    var submenu_top = offset.top - sub_menu.innerHeight() + menu_item.innerHeight();
    var submenu_left = 0;
    var space_on_right = (window.innerWidth - menu_item.parent().offset().left - menu_item.parent().width());
    if ((space_on_right + 200) > sub_menu.width()) {
      if (space_on_right >= sub_menu.width()) {
        submenu_left = offset.left + (menu_item.parent().width());
      } else {
        submenu_left = window.innerWidth - sub_menu.width();
      }
    } else if (space_on_right < sub_menu.width()) {
      submenu_left = offset.left - (sub_menu.width());
    } else {
      submenu_left = offset.left + (menu_item.parent().width());
    }

    if (submenu_top < 0) {
      submenu_top = 0;
    }

    return {
      'left': submenu_left,
      'top': submenu_top
    };
  }

  function add_sub_menu_item(sub_item, target) {
    var menu_item_inner = jquery_default()('<div class="J-N-Jz" />')
      .attr('title', sub_item['title'])
      .attr('style', 'user-select: none;width:250px;display:block;text-overflow: ellipsis;overflow: hidden; white-space: nowrap;');
    menu_item_inner.text(sub_item['title']);
    var sub_menu_item = jquery_default()('<div class="J-N" role="menuitem" aria-hidden="true" style="user-select: none;"></div>')
      .append(menu_item_inner)
      .appendTo(target);
    sub_menu_item.data('menu-item', sub_item);
    sub_menu_item.click(function () {
      callback(jquery_default()(this).data("menu-item"));
      sub_menu.hide();
    });
  }

  function display_submenu() {

    sub_menu_inner_div.empty();

    var item;
    var list = sub_items;
    try {
      if (list && list.length > 0) {

        for (var i = 0; i < list.length; i++) {

          item = list[i];

          switch(item['kind'] || '') {
            case 'separator':
              var sub_menu_sep = jquery_default()('<div class="J-Kh" aria-disabled="true" role="separator" style="user-select: none;z-index:10001"></div>');
              sub_menu_inner_div.append(sub_menu_sep);
              if (item['title'] && item['title'].trim() !== '') {
                var sub_menu_sep_with_text = jquery_default()('<div style="font-size:11px;font-weight:bold;margin:-5px 0 5px 0;padding:4px 0 5px 16px;background:#f9f9f9"></div>');
                sub_menu_sep_with_text.text(item['title'].trim());
                sub_menu_inner_div.append(sub_menu_sep_with_text);
              }
              break;

            default:
              add_sub_menu_item(item, sub_menu_inner_div);
              break;
          }
         
        }
      }
    } catch (ex) {
      console.log('error:', ex);
    }

    sub_menu.find('.J-N')
      .unbind('mouseenter').bind('mouseenter', function () {
        jquery_default()(this).addClass('J-N-JT');
      })
      .unbind('mouseleave').bind('mouseleave', function () {
        jquery_default()(this).removeClass('J-N-JT');
      });

    var position = calculate_submenu_position();

    sub_menu.css({
      'top': position.top + "px",
      'left': position.left + "px",
      'opacity': '1'
    }).show();
  }

  var menu_sep = null;
  var other_extension_menu_sep = null;
  if (menu.find('.cloudHQ__separator').length > 0) {
    other_extension_menu_sep = menu.find('.cloudHQ__separator').first();
  } else {
    menu_sep = jquery_default()('<div class="J-Kh cloudHQ__separator" aria-disabled="true" role="separator" style="user-select: none;"></div>');
  }

  var menu_item = jquery_default()('<div class="J-N ' + g_gmail_sheets_context_menu_item_class + '" role="menuitem" style="user-select: none;"><div class="J-N-Jz" style="user-select: none;"><div class="J-N-JX aDE BS" style="background-image: url(' + item['icon'] + ')"></div>' + item['title'] + '<span class="J-Ph-hFsbo submenu_icon" style="user-select: none;display:none;">►</span></div></div>');

  var sub_menu = jquery_default()('<div class="J-M agd aYO jQjAxd ' + g_gmail_sheets_context_sub_menu_item_class + '" style="user-select: none; top: 0px;display:none" role="menu" aria-haspopup="true"></div>').hide();
  var sub_menu_inner_div = jquery_default()('<div class="SK AX" style="user-select: none;"></div>').appendTo(sub_menu);
  jquery_default()('body').append(sub_menu);

  if (other_extension_menu_sep) {
    menu_item.insertAfter(other_extension_menu_sep);
  } else {
    menu_sep.insertBefore(menu.find('.J-Kh:nth(1)'));
    menu_item.insertAfter(menu_sep);
  }

  if (sub_items && sub_items.length > 0) {
    menu_item.find('.submenu_icon').show();
    menu_item.addClass('J-Ph')
  }

  menu_item.click(function () {
    if (sub_items && sub_items.length) {
      display_submenu();
    } else {
      callback(item);
    }
  })

  setup_hover();

  set_observer_on_menu();

  
}

function fn_add_context_view_menu_item() {

  var menu_list = jquery_default()('.J-M.J-M-ayU.Ft');
  if (menu_list.length == 0) {
    return;
  }

  menu_list.each(function() {
    var menu = jquery_default()(this);
    if (menu.find('.' + g_gmail_sheets_context_menu_item_class).length > 0) {
      return;
    }

    var sub_items = [];
    sub_items.push({
      'id': 'select_a_spreadsheet',
      'title': 'Select a spreadsheet ...',
    });
    sub_items.push({
      'id': 'new_spreadsheet',
      'title': 'New spreadsheet'
    });

    var list = g_recent_spreadsheets['list'] || [];
    if (list.length > 0) {

      sub_items.push({
        'kind': 'separator',
        'title': 'Recent spreadsheets'
      });

      for(var i = 0; i < list.length; i++) {
        sub_items.push({'id': list[i]['id'], 'title': list[i]['title']});
      }

    }

    fn_create_context_menu_item(menu,
      {
        'id': 'save_to_a_spreadsheet',
        'title': 'Save to a spreadsheet',
        'icon': g_server_url + 'images/gmail_sheets_ad_hoc_save.png?a=1'
      },
      sub_items,
      function (clicked_item) {
        switch (clicked_item['id']) {
          case 'select_a_spreadsheet':
            fn_handle_cloudHQ_thread_toolbar_ad_hoc_save_to_sheet();
            break;
          case 'new_spreadsheet':
            fn_display_create_new_spreadsheet_dialog();
            break;
          default:
            if (fn_check_selected_emails_and_display_dialog()) {
              return;
            }
            fn_save_email_to_sheet_call(clicked_item['id'], clicked_item['title']);
            break;
        }
      });
  });
}

