function fn_save_search_term_to_spreadsheet_with_redirect(search_term, selected_label_name, wizard_what) {
  if (!selected_label_name) { // no label

    var wizard_check_label_data = {
      'message_query': search_term,
      'wizard_create_label': true
    };
    c_g_cmn.fn_display_misc_dialog('<div style="width: 400px"><center>Finding all emails matching the search filter...</center></div>', '', null);
    c_g_cmn.fn_api_request('main_gmail_docs', 'wizard_check_label', wizard_check_label_data, 
      function (res) {

        var selected_label_name = res['label_name'];
        fn_save_search_term_to_spreadsheet_with_redirect_impl(search_term, selected_label_name, wizard_what)
      },
      function(res) {
        c_g_cmn.fn_close_misc_dialog();
        if (res && res['error']) {
          c_g_cmn.fn_display_misc_dialog('<div style="width: 400px"><center>' + res['error'] + '</center></div>', 'ERROR');
        } else {
          c_g_cmn.fn_display_misc_dialog('<div style="width: 400px"><center>Server error 4768! Unable to create a filter. <br/><br/>if this error persists, please email us at support@cloudHQ.net with the details (filter, which emails you are trying to save, etc.) and we will help.</center></div>', 'ERROR');
        }

      }
    );
  } else {
    fn_save_search_term_to_spreadsheet_with_redirect_impl(search_term, selected_label_name, wizard_what);
  }
}

function fn_get_label_name_from_message_query(message_query) {
  var message_query_label_name = null;
  try {
    if (message_query) {
      if (message_query.indexOf('cloudHQ__include_sublabels') !== -1) {
        message_query_label_name = message_query.replace('cloudHQ__include_sublabels','').replace('cloudHQ__filter_btn', '').replace('label:','').trim();
        return message_query_label_name;
      }
      if (message_query.indexOf('label:') !== -1) {
        var check_label_name = message_query.replace('cloudHQ__include_sublabels','').replace('cloudHQ__filter_btn', '').replace('label:','');
        var selected_label_name = jquery_default()('.TO.nZ.aiq [data-label-name]').attr('data-label-name');
        if (selected_label_name) { 
          if (selected_label_name.toUpperCase().trim().replaceAll(' ', '-') == check_label_name.toUpperCase().trim().replaceAll(' ', '-')) {
            message_query_label_name = selected_label_name.trim();
            return message_query_label_name;
          }
        }
      }
    }
  } catch(e) {
    console.log('fn_get_label_name_from_message_query: e=', e);
  }
  return message_query_label_name;
}

function fn_handle_cloudHQ_thread_toolbar_gmail_sheets_via_filter_btn(message_query) {

  // check the query
  if (message_query && message_query.indexOf('cloudHQ__filter_btn') !== -1) {
    try {
      var query_check = message_query.replace('cloudHQ__filter_btn', '').trim().replace('cloudHQ__include_sublabels','').replace('label:','').trim();
      if (!query_check) {
        c_g_cmn.fn_display_misc_dialog('<div style="width: 400px"><center>The message search filter could not be detected.<br/>Please refresh your browser and try again.<br/>If the error persists, try <a target="_blank" href="https://support.cloudhq.net/how-to-refresh-cached-images-and-files-in-chrome/">refreshing your Google Chrome cache</a> and attempting the action again.', 'ERROR', null);
        return false;
      }
    } catch(e) {
      console.log('load_form: error: e=', e);
    }
  }
  var thread_ids = fn_get_selected_thread_ids();
  var message_ids = fn_get_selected_message_ids();
  if (!fn_is_all_threads_selected() && (thread_ids.length + message_ids.length > 0)) {
    fn_handle_cloudHQ_thread_toolbar_ad_hoc_save_to_sheet();
  } else {
    c_g_cmn.fn_display_misc_dialog('<div style="width: 400px"><center>Loading... <br/>(might take a few seconds)</center></div>', ' ', null);
    let selected_label_name = null;
    selected_label_name = fn_get_label_name_from_message_query(message_query);
    if (selected_label_name) {
      message_query = null;
    }

    // remove cloudHQ__filter_btn
    if (message_query && message_query.indexOf('cloudHQ__filter_btn') !== -1) { 
      message_query = message_query.replace('cloudHQ__filter_btn', '').trim();
    }

    fn_save_to_spreadsheet_wizard_what_dialog(message_query, selected_label_name, function(message_query, selected_label_name, wizard_what) {
      fn_save_search_term_to_spreadsheet_with_redirect(message_query, selected_label_name, wizard_what);
    });
  }
}

